entation value=\"The actual content of the message\"/>\n      </searchParam>\n      <searchParam>\n        <name value=\"receiver\"/>\n        <definition value=\"http://hl7.org/fhir/SearchParameter/MessageHeader-receiver\"/>\n        <type value=\"reference\"/>\n        <documentation value=\"Intended &quot;real-world&quot; recipient for the data\"/>\n      </searchParam>\n      <searchParam>\n        <name value=\"response-id\"/>\n        <definition value=\"http://hl7.org/fhir/SearchParameter/MessageHeader-response-id\"/>\n        <type value=\"token\"/>\n        <documentation value=\"Id of original message\"/>\n      </searchParam>\n      <searchParam>\n        <name value=\"responsible\"/>\n        <definition value=\"http://hl7.org/fhir/SearchParameter/MessageHeader-responsible\"/>\n        <type value=\"reference\"/>\n        <documentation value=\"Final responsibility for event\"/>\n      </searchParam>\n      <searchParam>\n        <name value=\"sender\"/>\n        <definition value=\"http://hl7.org/fhir/SearchParameter/MessageHeader-sender\"/>\n        <type value=\"reference\"/>\n        <documentation value=\"Real world sender of the message\"/>\n      </searchParam>\n      <searchParam>\n        <name value=\"source\"/>\n        <definition value=\"http://hl7.org/fhir/SearchParameter/MessageHeader-source\"/>\n        <type value=\"string\"/>\n        <documentation value=\"Name of system\"/>\n      </searchParam>\n      <searchParam>\n        <name value=\"source-uri\"/>\n        <definition value=\"http://hl7.org/fhir/SearchParameter/MessageHeader-source-uri\"/>\n        <type value=\"uri\"/>\n        <documentation value=\"Actual message source address or id\"/>\n      </searchParam>\n      <searchParam>\n        <name value=\"target\"/>\n        <definition value=\"http://hl7.org/fhir/SearchParameter/MessageHeader-target\"/>\n        <type value=\"reference\"/>\n        <documentation value=\"Particular delivery destination within the destination\"/>\n      </searchParam>\n    </resource>\n    <resource>\n      <type value=\"MolecularSequence\"/>\n      <profile value=\"http://hl7.org/fhir/StructureDefinition/MolecularSequence\"/>\n      <interaction>\n        <code value=\"read\"/>\n        <documentation value=\"Implemented per the specification\"/>\n      </interaction>\n      <interaction>\n        <code value=\"vread\"/>\n        <documentation value=\"Implemented per the specification\"/>\n      </interaction>\n      <interaction>\n        <code value=\"update\"/>\n        <documentation value=\"Implemented per the specification\"/>\n      </interaction>\n      <interaction>\n        <code value=\"delete\"/>\n        <documentation value=\"Implemented per the specification\"/>\n      </interaction>\n      <interaction>\n        <code value=\"history-instance\"/>\n        <documentation value=\"Implemented per the specification\"/>\n      </interaction>\n      <interaction>\n        <code value=\"history-type\"/>\n        <documentation value=\"Implemented per the specification\"/>\n      </interaction>\n      <interaction>\n        <code value=\"create\"/>\n        <documentation value=\"Implemented per the specification\"/>\n      </interaction>\n      <interaction>\n        <code value=\"search-type\"/>\n        <documentation value=\"Implemented per the specification\"/>\n      </interaction>\n      <interaction>\n        <code value=\"patch\"/>\n        <documentation value=\"Implemented per the specification\"/>\n      </interaction>\n      <versioning value=\"versioned-update\"/>\n      <readHistory value=\"true\"/>\n      <updateCreate value=\"true\"/>\n      <conditionalCreate value=\"true\"/>\n      <conditionalRead value=\"full-support\"/>\n      <conditionalUpdate value=\"true\"/>\n      <conditionalDelete value=\"multiple\"/>\n      <referencePolicy value=\"literal\"/>\n      <referencePolicy value=\"local\"/>\n      <referencePolicy value=\"logical\"/>\n      <searchInclude value=\"MolecularSequence:patient\"/>\n      <searchRevInclude value=\"Observation:derived-from\"/>\n      <searchRevInclude value=\"Observation:has-member\"/>\n      <searchRevInclude value=\"Provenance:target\"/>\n      <searchParam>\n        <name value=\"chromosome\"/>\n        <definition value=\"http://hl7.org/fhir/SearchParameter/MolecularSequence-chromosome\"/>\n        <type value=\"token\"/>\n        <documentation value=\"Chromosome number of the reference sequence\"/>\n      </searchParam>\n      <searchParam>\n        <name value=\"chromosome-variant-coordinate\"/>\n        <definition value=\"http://hl7.org/fhir/SearchParameter/MolecularSequence-chromosome-variant-coordinate\"/>\n        <type value=\"composite\"/>\n        <documentation value=\"Search parameter by chromosome and variant coordinate. This will refer to part of a locus or part of a gene where search region will be represented in 1-based system. Since the coordinateSystem can either be 0-based or 1-based, this search query will include the result of both coordinateSystem that contains the equivalent segment of the gene or whole genome sequence. For example, a search for sequence can be represented as `chromosome-variant-coordinate=1$lt345$gt123`, this means it will search for the MolecularSequence resource with variants on chromosome 1 and with position &gt;123 and &lt;345, where in 1-based system resource, all strings within region 1:124-344 will be revealed, while in 0-based system resource, all strings within region 1:123-344 will be revealed. You may want to check detail about 0-based v.s. 1-based above.\"/>\n      </searchParam>\n      <searchParam>\n        <name value=\"chromosome-window-coordinate\"/>\n        <definition value=\"http://hl7.org/fhir/SearchParameter/MolecularSequence-chromosome-window-coordinate\"/>\n        <type value=\"composite\"/>\n        <documentation value=\"Search parameter by chromosome and window. This will refer to part of a locus or part of a gene where search region will be represented in 1-based system. Since the coordinateSystem can either be 0-based or 1-based, this search query will include the result of both coordinateSystem that contains the equivalent segment of the gene or whole genome sequence. For example, a search for sequence can be represented as `chromosome-window-coordinate=1$lt345$gt123`, this means it will search for the MolecularSequence resource with a window on chromosome 1 and with position &gt;123 and &lt;345, where in 1-based system resource, all strings within region 1:124-344 will be revealed, while in 0-based system resource, all strings within region 1:123-344 will be revealed. You may want to check detail about 0-based v.s. 1-based above.\"/>\n      </searchParam>\n      <searchParam>\n        <name value=\"identifier\"/>\n        <definition value=\"http://hl7.org/fhir/SearchParameter/MolecularSequence-identifier\"/>\n        <type value=\"token\"/>\n        <documentation value=\"The unique identity for a particular sequence\"/>\n      </searchParam>\n      <searchParam>\n        <name value=\"patient\"/>\n        <definition value=\"http://hl7.org/fhir/SearchParameter/MolecularSequence-patient\"/>\n        <type value=\"reference\"/>\n        <documentation value=\"The subject that the observation is about\"/>\n      </searchParam>\n      <searchParam>\n        <name value=\"referenceseqid\"/>\n        <definition value=\"http://hl7.org/fhir/SearchParameter/MolecularSequence-referenceseqid\"/>\n        <type value=\"token\"/>\n        <documentation value=\"Reference Sequence of the sequence\"/>\n      </searchParam>\n      <searchParam>\n        <name value=\"referenceseqid-variant-coordinate\"/>\n        <definition value=\"http://hl7.org/fhir/SearchParameter/MolecularSequence-referenceseqid-variant-coordinate\"/>\n        <type value=\"composite\"/>\n        <documentation value=\"Search parameter by reference sequence and variant coordinate. This will refer to part of a locus or part of a gen